  const [dados, setDados] = useState()

const dadosObj = {
  dados,
  setDados
}

  return (
    <div className="App">
   <Router/>


<InfosContext.Provider value = {dadosObj}>

</InfosContext.Provider>

    </div>
  );
}

export default App;
